import React from 'react';

const Resources = () => {
  const resources = [
    {
      id: 1,
      title: 'React Documentation',
      description: 'Official React documentation and tutorials',
      url: 'https://react.dev/',
      category: 'Documentation'
    },
    {
      id: 2,
      title: 'React Router',
      description: 'Declarative routing for React applications',
      url: 'https://reactrouter.com/',
      category: 'Routing'
    },
    {
      id: 3,
      title: 'React Hooks',
      description: 'Learn about React Hooks and their usage',
      url: 'https://react.dev/reference/react',
      category: 'Hooks'
    },
    {
      id: 4,
      title: 'Context API',
      description: 'React Context for state management',
      url: 'https://react.dev/learn/passing-data-deeply-with-context',
      category: 'State Management'
    },
    {
      id: 5,
      title: 'useReducer Hook',
      description: 'Complex state logic with useReducer',
      url: 'https://react.dev/reference/react/useReducer',
      category: 'Hooks'
    },
    {
      id: 6,
      title: 'Performance Optimization',
      description: 'React performance best practices',
      url: 'https://react.dev/learn/render-and-commit',
      category: 'Performance'
    }
  ];

  const categories = [...new Set(resources.map(resource => resource.category))];

  return (
    <div className="resources">
      <h2>Learning Resources</h2>
      <p>This component is lazy loaded using React.lazy() and Suspense!</p>
      
      <div className="resources-overview">
        <h3>Available Categories</h3>
        <div className="category-tags">
          {categories.map(category => (
            <span key={category} className="category-tag">
              {category}
            </span>
          ))}
        </div>
      </div>

      <div className="resources-grid">
        {resources.map(resource => (
          <div key={resource.id} className="resource-card">
            <div className="resource-header">
              <h4>{resource.title}</h4>
              <span className="resource-category">{resource.category}</span>
            </div>
            <p className="resource-description">{resource.description}</p>
            <a
              href={resource.url}
              target="_blank"
              rel="noopener noreferrer"
              className="resource-link"
            >
              Visit Resource â†’
            </a>
          </div>
        ))}
      </div>

      <div className="lazy-loading-info">
        <h3>Lazy Loading Demo</h3>
        <p>
          This Resources component demonstrates React's lazy loading capabilities:
        </p>
        <ul>
          <li>Component is loaded only when needed</li>
          <li>Reduces initial bundle size</li>
          <li>Uses React.lazy() and Suspense</li>
          <li>Shows loading spinner while loading</li>
        </ul>
      </div>
    </div>
  );
};

export default Resources;
